const ListPekerjaan = (props) => {
    const {data} = props

    return (
        <>  
            <div>
            <input type="checkbox"/>
            {data.map((list) =>  <lable>{list.title}</lable> )}
            </div>
            </>
            
    )
}

export default ListPekerjaan;
